                 height:'25px',
                lineHeight: '50px',
                backgroundColor: 'white',
                color: 'black',
                bottom: '3%',
                left: '40%',
                textDecoration:'none',
                color:'#4267b2'

              }}>
                 {e.comments}
               </p>
            ))
        } */}
         <ImageView 
            src={log.image}
            offShow={props.status}
            log={log}
            id={log.id}
            uid={props.uid}
            name={props.name}
        />


        </div>
    )
}

export default LogView;
